        console.log("Sign Out");
        removeCookie('Email');
        removeCookie('AuthToken');
        window.location.reload();
      }

    return (
    <div class="navbar" width="100px">
          <div class="navbar-logo">
            <img src="/static/images/Imagify_logo.png" alt="Logo" />
          </div>
          
